-(void) JSHook_onExit
{
	//1st call native, then JS. Order is important
	[self JSHook_onExit];
	JSPROXY_CCNode *proxy = objc_getAssociatedObject(self, &JSPROXY_association_proxy_key);
	if( proxy )
		[proxy onExit];
}

